import React from 'react';
import { Typography, Box, Link, Button, Container } from '@mui/material';
import backgroundImage from '../assets/bg.png';

function Publications() {
  const publications = [
    {
      title: "SplitFS: Reducing Software Overhead in File Systems for Persistent Memory",
      authors: "Rohan Kadekodi, Se Kwon Lee, Sanidhya Kashyap, Taesoo Kim, Aasheesh Kolli, Vijay Chidambaram",
      note: "SOSP '19",
      links: [
        { label: "pdf", url: "/pdfs/splitfs.pdf" },
        { label: "slides", url: "/pdfs/splitfs-slides.pdf" },
        { label: "bibtex", url: "/bibtex/splitfs.bib" }
      ]
    },
    {
      title: "RECIPE: Converting Concurrent DRAM Indexes to Persistent-Memory Indexes",
      authors: "Se Kwon Lee, Jayashree Mohan, Sanidhya Kashyap, Taesoo Kim, Vijay Chidambaram",
      note: "SOSP '19",
      links: [
        { label: "pdf", url: "/pdfs/recipe.pdf" },
        { label: "slides", url: "/pdfs/recipe-slides.pdf" },
        { label: "bibtex", url: "/bibtex/recipe.bib" }
      ]
    },
    {
      title: "Analyzing GDPR Compliance Through the Lens of Privacy Policies",
      authors: "Jayashree Mohan, Melissa Wasserman, Vijay Chidambaram",
      note: "VLDB '19",
      links: [
        { label: "pdf", url: "/pdfs/gdpr-compliance.pdf" },
        { label: "slides", url: "/pdfs/gdpr-compliance-slides.pdf" },
        { label: "bibtex", url: "/bibtex/gdpr-compliance.bib" }
      ]
    },
    {
      title: "Analyzing the Impact of GDPR on Storage Systems",
      authors: "Aashaka Shah, Vinay Banakar, Supreeth Shastri, Melissa Wasserman, Vijay Chidambaram",
      note: "HotStorage '19",
      links: [
        { label: "pdf", url: "/pdfs/gdpr-impact.pdf" },
        { label: "slides", url: "/pdfs/gdpr-impact-slides.pdf" },
        { label: "bibtex", url: "/bibtex/gdpr-impact.bib" }
      ]
    },
    {
      title: "The Seven Sins of Personal-Data Processing Systems under GDPR",
      authors: "Supreeth Shastri, Melissa Wasserman, Vijay Chidambaram",
      note: "HotCloud '19",
      links: [
        { label: "pdf", url: "/pdfs/seven-sins.pdf" },
        { label: "slides", url: "/pdfs/seven-sins-slides.pdf" },
        { label: "bibtex", url: "/bibtex/seven-sins.bib" }
      ]
    },
    {
      title: "Finding Crash-Consistency Bugs with Bounded Black-Box Crash Testing",
      authors: "Jayashree Mohan, Ashlie Martinez, Soujanya Ponnappalli, Pandian Raju, Vijay Chidambaram",
      note: "OSDI '18",
      links: [
        { label: "pdf", url: "/pdfs/crash-consistency.pdf" },
        { label: "slides", url: "/pdfs/crash-consistency-slides.pdf" },
        { label: "bibtex", url: "/bibtex/crash-consistency.bib" }
      ]
    },
    {
      title: "mLSM: Making Authenticated Storage Faster in Ethereum",
      authors: "Pandian Raju, Soujanya Ponnappalli, Evan Kaminsky, Gilad Oved, Zachary Keener, Vijay Chidambaram",
      note: "HotStorage '18",
      links: [
        { label: "pdf", url: "/pdfs/mlsm.pdf" },
        { label: "slides", url: "/pdfs/mlsm-slides.pdf" },
        { label: "bibtex", url: "/bibtex/mlsm.bib" }
      ]
    },
    {
      title: "PebblesDB: Building Key-Value Stores using Fragmented Log-Structured Merge Trees",
      authors: "Pandian Raju, Rohan Kadekodi, Vijay Chidambaram, Ittai Abraham",
      note: "SOSP '17",
      links: [
        { label: "pdf", url: "/pdfs/pebblesdb.pdf" },
        { label: "slides", url: "/pdfs/pebblesdb-slides.pdf" },
        { label: "bibtex", url: "/bibtex/pebblesdb.bib" }
      ]
    }
  ];

  return (
    <Box sx={{
      pt: 4,
      px: 3,
      py: 4,
      backgroundImage: `linear-gradient(rgba(0, 0, 0, 0.7), rgba(0, 0, 0, 0.7)), url(${backgroundImage}),`,
      backgroundSize: 'cover',
      backgroundPosition: 'center',
      color: '#ffffff ', 
      textAlign: 'left',
    }}>
      <Typography variant="h4" sx={{ mb: 4, fontWeight: 'bold', textShadow: '1px 1px 2px rgba(0,0,0,0.7)' }}>
        Recent Publications
      </Typography>
      <Container>
        {publications.map((pub, index) => (
          <Box key={index} sx={{ display: 'flex', mb: 2 }}>
            <Box sx={{
              backgroundColor: '#ff6600',
              color: '#fff',
              borderRadius: '50%',
              width: '32px',
              height: '32px',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              mr: 2,
              fontWeight: 'bold'
            }}>
              {index + 1}
            </Box>
            <Box>
              <Typography variant="body1" sx={{ fontWeight: 'bold', fontSize: '1.1rem', color: '#ffffff' }}>
                {pub.title}
              </Typography>
              <Typography variant="body2" sx={{ color: '#ffffff' }}>
                {pub.authors}
              </Typography>
              <Typography variant="body2" sx={{ mb: 1, color: '#ffffff' }}>
                {pub.note}
              </Typography>
              {pub.links.map((link, idx) => (
                <Link key={idx} href={link.url} target="_blank" sx={{ color: '#ff6600', textDecoration: 'underline', mr: 2 }}>
                  [{link.label}]
                </Link>
              ))}
            </Box>
          </Box>
        ))}
        <Box sx={{ textAlign: 'center', mt: 4 }}>
          <Button variant="contained" sx={{ backgroundColor: '#ff6600', color: '#fff', fontWeight: 'bold', borderRadius: '20px', px: 4 }}>
            All Publications
          </Button>
        </Box>
      </Container>
    </Box>
  );
}

export default Publications;
